                        </thead>
                        <tbody>
                            <tr>
                                <td>1</td>
                                <td>Honey</td>
                                <td>With no milk</td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        )
    }
}

export default ListNotesComponent
